:36:37.000Z\"},{\"author_id\":\"50787229\",\"entities\":{\"urls\":[{\"start\":12,\"end\":35,\"url\":\"https://t.co/Dts4glxyOe\",\"expanded_url\":\"https://twitter.com/florenciocano/status/1369552037118156804/photo/1\",\"display_url\":\"pic.twitter.com/Dts4glxyOe\"}],\"mentions\":[{\"start\":0,\"end\":11,\"username\":\"olesovhcom\"}]},\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1369478732247932929\"}],\"id\":\"1369552037118156804\",\"source\":\"Plume for Android\",\"attachments\":{\"media_keys\":[\"3_1369552034555387906\"]},\"in_reply_to_user_id\":\"290971726\",\"lang\":\"und\",\"conversation_id\":\"1369478732247932929\",\"public_metrics\":{\"retweet_count\":179,\"reply_count\":5,\"like_count\":1151,\"quote_count\":15},\"text\":\"@olesovhcom https://t.co/Dts4glxyOe\",\"created_at\":\"2021-03-10T07:33:45.000Z\"},{\"author_id\":\"1686323288\",\"possibly_sensitive\":false,\"referenced_tweets\":[{\"type\":\"replied_to\",\"id\":\"1368636398992056323\"}],\"id\":\"1368637789248626699\",\"source\":\"Twitter for iPhone\",\"in_reply_to_user_id\":\"1686323288\",\"lang\":\"en\",\"conversation_id\":\"1365214528145874946\",\"public_metrics\":{\"retweet_count\":254,\"reply_count\":35,\"like_count\":1454,\"quote_count\":70},\"entities\":{\"mentions\":[{\"start\":0,\"end\":13,\"username\":\"isostandards\"},{\"start\":14,\"end\":20,\"username\":\"mikko\"}]},\"text\":\"@isostandards @mikko The value of standards is in their adoption. ISO obstructs adoption of standards by paywalling them, making it impractical for millions of hobbyist programmers to access to them and be able to even understand what the standard is.\",\"created_at\":\"2021-03-07T19:00:51.000Z\"},{\"author_id\":\"183749519\",\"possibly_sensitive\":false,\"id\":\"1366100857322881026\",\"source\":\"Twitter Web App\",\"lang\":\"en\",\"conversation_id\":\"1366100857322881026\",\"public_metrics\":{\"retweet_count\":2292,\"reply_count\":123,\"like_count\":14937,\"quote_count\":131},\"